import React from "react";
import { getHomes } from "../service/home.service";

class HomeList extends React.Component {
  state = {
    homes: [],
  };

  componentDidMount() {
    this.setState({ homes: getHomes() });
  }

  render() {
    return (
      <div>
        {this.state.homes.map((home) => (
          <div>{home}</div>
        ))}
      </div>
    );
  }
}

export default HomeList;
